import React from 'react';
import { action } from '@storybook/addon-actions';
import { BrowserRouter } from 'react-router-dom'
import Content from '../components/Content'
import CustomCheckBox from '../components/Icons/customCheckbox';
import { button } from '@material-ui/core';


export default {
  title: 'Content',
  component: Content,
};

export function ContentContainter() {

return (
  <Content 
    key=''
    subHeader='SubHeader Section'
    body={
      <button 
          className="MuiButton" 
          onClick={action("I've been clicked")}>
          This is where a component can be passed
        </button>
      }
    containerClass={classes.generalContainer}
    headerClass='HEADER'
  />
);

}
